import React, { Component, Fragment } from "react";
import EventoPreview from "./eventoPreview";

class showEventosAtivos extends Component {
  render() {
    const { eventosAtivos } = this.props;
    return (
      <Fragment>
        <div className="container">
          <div id="active" className="card-panel z-depth-2">
            <h3 style={{ textAlign: "center" }}> Eventos Ativos </h3>
            {eventosAtivos.map(evento => (
              <EventoPreview evento={evento} key={evento.id} />
            ))}
          </div>
        </div>
      </Fragment>
    );
  }
}

export default showEventosAtivos;
